import React from "react";
import { SAVE_NEW_WELL_TO_REDUX_STORE } from './types'

const saveNewWellToReduxStore = (well) => dispatch => {

  dispatch({type: SAVE_NEW_WELL_TO_REDUX_STORE, payload: well})
}

export default saveNewWellToReduxStore
